import React, {Component} from 'react';
import {connect} from 'react-redux';
import CurrencyListItem from '../currency-list-item/currency-list-item';
import {
  currenciesLoaded,
  convertibleCurrency
} from '../../actions/index';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import {Link} from 'react-router-dom';
import CurrencyService from '../../services/currency-service';
import Spinner from '../spinner/spinner';

import './currency-list.css';

class CurrencyList extends Component {
  currencyService = new CurrencyService();

	componentDidMount() {
		const {currencyValue, value, value2, v3} = this.props;



    this.currencyService
			.getCurrency().then((currency) => {
				this.props.currenciesLoaded(currency);
			});

		console.log('');
		console.log('-->START LIST');
		console.log('Value1: ', value);
		console.log('Value2: ', value2);
		console.log('Value3: ', v3);
		console.log('END LIST<--');
		console.log('');
	};




	render() {
    const {currency, onGetValue} = this.props;
    const data = this.props.currency;
    const loading = this.props.loading;

    const currencyCodeDefault = data.length > 0 ? data[0].key : 0;

		if(loading) {
			return (
				<Spinner />
			);
		}

		return (
			<div className="wrCurrencyList">
				<div className="wrHeaderCurrencyList">
					<Link to="/" className="wrHomeBtn">
						<ArrowBackIcon className="homeBtn" />
					</Link>
					<span className="titleCurrencyList">Currency Codes</span>
				</div>

				<ul className="currencyList">
					<CurrencyListItem data={currency} onGetValue={onGetValue} />
				</ul>
			</div>
		);
	};
};

const mapStateToProps = ({currency, value, value2, v3, loading}) => {
	return {
		currency,
		value,
		value2,
		v3,
    loading
	};
};

const mapStateDispatchToProps = (dispatch) => {
	return {
    currenciesLoaded: (currency) => {
			dispatch(currenciesLoaded(currency));
		},

		onGetValue: (a,b) => {
			dispatch(convertibleCurrency(a,b));
		}
	};
};

export default connect(mapStateToProps, mapStateDispatchToProps)(CurrencyList);
